INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('GSHD', 'STOCK', 'Goosehead Insurance, Inc', 'NMS', 'Financial Services', 'Insurance Brokers', 'Goosehead Insurance, Inc. is an independent personal lines insurance agency. The Company is engaged in distributing personal line policies throughout the United States. It offers Digital Agent, an online quoting platform, that allows clients to shop their home and auto insurance rates with top carriers. The Digital Agent combines millions of data points, which includes its quoting data over hundreds of thousands of transactions, to bring clients actual quotes specific to their needs. Clients can then bind these quotes through a short call with one of its local licensed agents with expertise in the client''s specific market. It distributes insurance policies for a range of primarily personal lines of business, including homeowners insurance, automotive, dwelling property insurance, flood, wind and earthquake insurance, excess liability or umbrella insurance, specialty lines insurance (motorcycle, recreational vehicle, and other insurance), commercial lines insurance and life insurance.', 'Westlake, TX, United States', 1580);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELME', 'STOCK', 'Elme Communities', 'NYQ', 'Real Estate', 'REIT - Residential', 'Elme Communities is a multifamily real estate investment trust. The Company operates in a single reportable segment which includes the ownership, development, redevelopment and acquisition of apartment communities. It owns and operates approximately 9,400 apartment homes in the Washington, DC metro and the Atlanta metro regions, and owns approximately 300,000 square feet of commercial space. The Company''s properties include Elme Alexandria, Cascade at Landmark, Clayborne, Riverside Apartments, Bennett Park, Park Adams, The Maxwell, The Paramount, The Wellington, Trove, Roosevelt Towers, Elme Dulles, Elme Herndon, The Ashby at McLean, Kenmore Apartments, Elme Watkins Mill, Elme Germantown, Elme Eagles Landing, Elme Druid Hills, Watergate 600, among others.', 'Bethesda, MD, United States', 255);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNA', 'STOCK', 'CNA Financial Corporation', 'NYQ', 'Financial Services', 'Insurance - Property & Casualty', 'CNA Financial Corporation is an insurance holding company. The Companys segments include Specialty, Commercial, International, Life & Group and Corporate & Other. The Specialty segment provides management and professional liability and other coverages through property and casualty products and services using a network of brokers, independent agencies and managing general underwriters. The Commercial segment works with a network of brokers and independent agents to market a range of property and casualty insurance products to all types of insureds, targeting small business, construction, middle markets and other commercial customers. The International segment underwrites property and casualty coverage on a global basis through a branch operation in Canada, a European business consisting of insurance companies based in the United Kingdom and Luxembourg and Hardy, its Lloyd''s syndicate. The Life & Group segment includes the results of its long-term care business that is in run-off.', 'Chicago, IL, United States', 6500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATLX', 'STOCK', 'Atlas Lithium Corporation', 'NCM', 'Basic Materials', 'Other Industrial Metals & Mining', 'Atlas Lithium Corporation is a mineral exploration company with exploration projects for strategic minerals in Brazil. The Companys properties encompass approximately 539 square kilometers for lithium, as well as mineral rights for nickel, rare earths, titanium and graphite. It also owns multiple mining concessions for gold, diamond, and industrial sand. The Company is advancing to produce its wholly owned hard-rock lithium Neves Project located in the state of Minas Gerais, Brazil. It also holds an approximate 32% ownership stake in Atlas Critical Minerals Corporation, a diversified mining company with significant mineral rights in rare earths, copper, graphite, nickel, iron ore, gold, and quartzite. Its Minas Gerais Lithium Project is its largest endeavor and consists of about 85 mineral rights totaling approximately 468 square kilometers. The Companys Northeastern Brazil Lithium Project encompasses seven mineral rights spread over approximately 71 square kilometers.', 'Belo Horizonte, MG, Brazil', 70);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASC', 'STOCK', 'Ardmore Shipping Corporation', 'NYQ', 'Industrials', 'Marine Shipping', 'Ardmore Shipping Corporation is engaged in the ownership and operation of product and chemical tankers in worldwide trade. The Company operates through one segment, which is transportation of refined petroleum products and chemicals. The Company provides seaborne transportation of petroleum products and chemicals worldwide to oil majors, national oil companies, oil and chemical traders, and chemical companies, with its fleet of mid-size product and chemical tankers. It provides shipping services to customers through voyage charters, time charters, and commercial pools. It has the global network to support its seafarers and deliver shipping services to its customers. Its vessels include Ardmore Seafarer, Ardmore Exporter, Ardmore Explorer, Ardmore Enterprise, Ardmore Engineer, Ardmore Endurance, Ardmore Endeavour, Ardmore Encounter, Ardmore Seahawk, Ardmore Seavanguard, Ardmore Seavantage, Ardmore Seaventure, Ardmore Chippewa, Ardmore Chinook, and Ardmore Seavaliant, among others.', 'Hamilton, , Bermuda', 56);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('JUNS', 'STOCK', 'Jupiter Neurosciences, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Jupiter Neurosciences, Inc. is a clinical-stage research and development pharmaceutical company. The Company has developed a resveratrol platform product targeting the treatment of neuro-inflammation. Its product, JOTROL, has many potential indications of use for rare diseases, which primarily targets Mucopolysaccharidoses Type 1, Friedreich''s Ataxia, and Mitochondrial Encephalopathy, Lactic Acidosis, and Stroke-like episodes (MELAS). In the larger disease areas, it primarily targets Parkinsons Disease and Mild Cognitive Impairment/early Alzheimers disease. The Company has designated the different indications with project numbers, JNS101 - JNS115. JOTROL is a micellar non-aqueous solution of resveratrol delivered in a soft gel capsule. Each capsule includes 100mg of resveratrol. It has a worldwide license from Aquanova AG, the patent holder of micellar technologies, to develop, manufacture, distribute and sell JOTROL.', 'Jupiter, FL, United States', 4);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EWTX', 'STOCK', 'Edgewise Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Edgewise Therapeutics, Inc. is a muscle disease biopharmaceutical company developing novel therapeutics for muscular dystrophies and serious cardiac conditions. The Companys lead product candidate, sevasemten (EDG-5506), is an orally administered skeletal myosin inhibitor in late-stage clinical trials in Becker and Duchenne muscular dystrophies. Its EDG-7500 is a novel cardiac sarcomere modulator for the treatment of hypertrophic cardiomyopathy and other diseases of diastolic dysfunction, which is in Phase II clinical development. The Company is using its proprietary drug discovery platform to develop a pipeline of precision medicine product candidates that target key muscle proteins and modulators to address a broad array of serious muscle disorders. Its platform utilizes custom-built high throughput and translatable systems that measure integrated muscle function in whole organ extracts to identify small molecule precision medicines regulating key proteins in muscle tissue.', 'Boulder, CO, United States', 126);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRS', 'STOCK', 'Carpenter Technology Corporation', 'NYQ', 'Industrials', 'Metal Fabrication', 'Carpenter Technology Corporation is engaged in the manufacturing, fabrication and distribution of specialty metals. The Company operates in two segments: Specialty Alloys Operations (SAO) and Performance Engineered Products (PEP). The SAO segment comprises its premium alloy and stainless-steel manufacturing operations. This includes operations performed at mills primarily in Reading and Latrobe, Pennsylvania and surrounding areas, as well as South Carolina and Alabama. The PEP segment comprises its differentiated operations. This segment includes the Dynamet titanium business, the Carpenter Additive business and the Latrobe and Mexico distribution businesses. It provides specialty alloy-based materials and process solutions for critical applications in the aerospace, defense, medical, transportation, energy, industrial and consumer markets. The Company operates its own network of service and distribution centers, located in the United States, Canada, Mexico, Europe and Asia.', 'Philadelphia, PA, United States', 4500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EE', 'STOCK', 'Excelerate Energy, Inc.', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'Excelerate Energy, Inc. is a liquefied natural gas (LNG) company. The Company offers a full range of flexible regasification services from floating storage and regasification units (FSRUs) to infrastructure development, to LNG and natural gas supply. The Company operates a fleet of ten purpose-built FSRUs, have completed more than 2,700 ship-to-ship (STS) transfers of LNG with over 50 LNG operators and delivered more than 6,600 billion cubic feet of natural gas through 16 LNG regasification terminals. In addition to standard LNG carrier functionality, its purpose-built FSRUs have the onboard capability to vaporize LNG and deliver natural gas through specially designed offshore and near-shore receiving facilities. Its business spans the globe, with regional offices in approximately 10 countries and operations in the Argentina, Bangladesh, Brazil, Finland, Pakistan, the United Arab Emirates (UAE), and the United States.', 'The Woodlands, TX, United States', 919);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLPT', 'STOCK', 'ClearPoint Neuro, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'ClearPoint Neuro, Inc. is a device, cell, and gene therapy-enabling company offering precise navigation to the brain and spine. The Company provides both clinical products as well as pre-clinical development services for controlled drug and device delivery. Its flagship product is the ClearPoint Neuro Navigation System. The Company is engaged with healthcare and research centers in North America, Europe, Asia, and South America. Its primary medical device product, the ClearPoint system, is an integrated system comprised of hardware components, disposable components, and intuitive, menu-driven software. Its ClearPoint Prism Neuro Laser Therapy System is indicated for use to necrotize or coagulate soft tissue through interstitial irradiation or thermal therapy for neuro applications under 3.0T magnetic resonance imaging (MRI) guidance. The Company also provides solutions for direct CNS delivery of therapeutics in preclinical studies and clinical trials worldwide.', 'Solana Beach, CA, United States', 115);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CON', 'STOCK', 'Concentra Group Holdings Parent, Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Concentra Group Holdings Parent, Inc. is a provider of occupational health services in the United States. It delivers an extensive suite of services, including occupational and consumer health services and other direct-to-employer care, to more than 50,000 patients each day, on average, from about 620 occupational health centers in 41 states and 160 onsite health clinics at employer worksites in 36 states. Its Occupational Health Centers segment encompasses the services it delivers at its occupational health center facilities across the United States. Its Onsite Health Clinics segment delivers occupational health services and/or employer-sponsored primary care services at an employers workplace, including mobile health services and episodic specialty testing services. Its Other Businesses segment comprises several complementary services to its core occupational health services offering and includes Concentra Telemed, Concentra Pharmacy and Concentra Medical Compliance Administration.', 'Addison, TX, United States', 8758);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APYX', 'STOCK', 'Apyx Medical Corporation', 'NMS', 'Healthcare', 'Medical Devices', 'Apyx Medical Corporation is an advanced energy technology company. The Company''s segments include Advanced Energy and Original Equipment Manufacturer (OEM). The Advanced Energy segment''s product portfolio consists of Helium Plasma Technology, which is marketed and sold as Renuvion in the cosmetic surgery market, and J-Plasma in the hospital surgical market. It focuses on the cosmetic surgery market, where Renuvion offers plastic surgeons, facial plastic surgeons and cosmetic physicians the ability to provide controlled heat to the tissue to achieve their desired results. These product lines consist of a multifunction generator, a handpiece and a supply of helium gas. Through OEM agreements, the OEM segment produces generators, medical devices, and related accessories for medical device manufacturers as well as start-up businesses in need of its energy-based designs. It specializes in the design, development, and manufacturing of electrosurgical equipment and medical devices.', 'Clearwater, FL, United States', 220);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATEN', 'STOCK', 'A10 Networks, Inc.', 'NYQ', 'Technology', 'Software - Infrastructure', 'A10 Networks, Inc. provides security and infrastructure solutions for on-premises, hybrid cloud, and edge-cloud environments. Its product portfolio seeks to address many of the cyber protection challenges and solution requirements. Its security solutions include App & API Security, DNS Security and Secure Web Gateway. Its infrastructure solutions include public cloud, private cloud and broadband growth. Its solutions are available in a variety of form factors, such as optimized hardware appliances, bare metal software, containerized software, virtual appliances and cloud-native software. Its solutions serve various industries including healthcare, higher education, financial services and telecommunications & service providers. Its products include A10 Defend, A10 Infrastructure and centralized management & analytics (A10 Control). It offers TX Protect Web application and API protection solution. Its intelligent management and automation tools include Harmony Controller and aGalaxy TPS.', 'San Jose, CA, United States', 481);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EME', 'STOCK', 'EMCOR Group, Inc.', 'NYQ', 'Industrials', 'Engineering & Construction', 'EMCOR Group, Inc. is a specialty contractor. The Company provides mechanical and electrical construction services, industrial and energy infrastructure and building services. Its services are provided to a range of commercial, technology, manufacturing, industrial, healthcare, utility, and institutional customers through approximately 100 operating subsidiaries. Such operating subsidiaries are organized into the various reportable segments, including United States electrical construction and facilities services, United States mechanical construction and facilities services, United States building services, United States industrial services, and United Kingdom building services. Its electrical and mechanical construction services primarily involve the design, integration, installation, start-up, operation and maintenance, and provision of services relating to roadway and transit lighting and signaling and fiber optic lines, and fire protection and suppression systems.', 'Norwalk, CT, United States', 40400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATXG', 'STOCK', 'Addentax Group Corp.', 'NCM', 'Industrials', 'Integrated Freight & Logistics', 'Addentax Group Corp is a China-based holding company principally engaged in the manufacture of garment and provision of logistic services. The Company operates through four main segments. Garment Manufacturing Business segment is engaged in the production of garment and sales of garment to wholesalers. Logistic Business segment is involved in the provision of delivery and courier services covering approximately 79 cities and two municipalities in China. Property Management and Subleasing business segment provides shops subleasing and property services for garment wholesalers and retailers. Epidemic Prevention Supplies Business segment is involved in manufacturing and distribution of epidemic prevention products and resale of epidemic prevention supplies. The Company is also outsourcing some of the businesses to contractors.', 'Shenzhen, , China', 112);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EQ', 'STOCK', 'Equillium, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Equillium, Inc. is a clinical-stage biotechnology company. It is engaged in developing novel therapeutics to treat severe autoimmune and inflammatory disorders with high unmet medical need. The Companys pipeline consists of immunomodulatory assets and a product platform targeting immuno-inflammatory pathways. Its EQ302 is a selective bi-specific cytokine inhibitor targeting IL-15 and IL-21. EQ101 is a clinical-stage, selective, tri-specific inhibitor of IL-2, IL-9 and IL-15, which are key disease-driving, clinically validated cytokine targets to address unmet needs across a range of immuno-inflammatory indications. Its multi-cytokine platform generates rationally designed composite peptides that selectively block key cytokines at the shared receptor level, targeting pathogenic cytokine redundancies and synergies. The Itolizumab is a monoclonal antibody that targets the CD6-ALCAM signaling pathway, which plays a central role in the modulation of effector T cells.', 'La Jolla, CA, United States', 35);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ZJYL', 'STOCK', 'Jin Medical International Ltd.', 'NCM', 'Healthcare', 'Medical Instruments & Supplies', 'Jin Medical International Ltd is a holding company mainly engaged in the design and manufacturing of wheelchairs. The Company, through its wholly owned subsidiaries, is primarily engaged in the design, development, manufacturing and sales of wheelchair and other living aids products to be used by people with disabilities or impaired mobility. The Company''s wheelchair product category includes mid, high and low-end wheelchairs. The wheelchair components include wheels and brakes, which are sold to customers for after-sales service. The living aids product category consists of oxygen concentrators, bath aids and rehabilitative devices. The Company mainly distributes its products in domestic and overseas markets.', 'Changzhou, , China', 269);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AREB', 'STOCK', 'American Rebel Holdings, Inc.', 'NCM', 'Consumer Cyclical', 'Footwear & Accessories', 'American Rebel Holdings, Inc. operates primarily as a designer, manufacturer and marketer of branded safes and personal security and self-defense products. Additionally, the Company designs and produces branded apparel and accessories. In addition to branded safes, it offers an assortment of personal security products as well as apparel and accessories for men and women under the Companys American Rebel brand. The Companys safes and personal security products are constructed primarily of United States-made steel. Its products are designed to safely store firearms, as well as store its customers priceless keepsakes, family heirlooms and treasured memories and other valuables. It produces large floor safes in a variety of sizes as well as small portable keyed safes. It sells its products online to individuals desiring home, personal and office protection, as well as to recreational shooters and hunters. Its gun safes include Constitution 25 Gun Safe and Constitution 40 Gun Safe.', 'Brentwood, TN, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DEA', 'STOCK', 'Easterly Government Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Office', 'Easterly Government Properties, Inc. is an internally managed real estate investment trust (REIT). It is focused primarily on the acquisition, development and management of Class A commercial properties that are leased to United States government agencies that serve essential functions. It leases its properties to such agencies either directly or through the United States General Services Administration (GSA). The operations of the Company are carried out primarily through Easterly Government Properties, LP (the Operating Partnership) and the wholly owned subsidiaries of the Operating Partnership. The Company owns, directly or through the joint venture, 102 properties totaling 10.2 million square feet. Its properties include VA - Loma Linda, JSC - Suffolk, Various GSA - Chicago, IRS - Fresno, FBI - Salt Lake, VA - San Jose, EPA - Lenexa, FBI - Tampa, FBI - San Antonio, FDA - Alameda, PTO - Arlington, FBI - Omaha, TREAS - Parkersburg, FDA - Lenexa, VA - South Bend, and DHS - Burlington.', 'Washington, DC, United States', 50);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('API', 'STOCK', 'Agora, Inc.', 'NMS', 'Technology', 'Software - Application', 'Agora Inc. is a holding company of two independent divisions, under the Agora brand and Shengwang brand, whose businesses are conducted through separate entities. Agora provides Real-Time Engagement Platform-as-a-Service (PaaS) that operates in the United States, as well as other international markets outside the United States and China. Shengwang provides Real-Time Engagement PaaS in the China market. The Company provides developers with customizable and compatible application programming interfaces (APIs), to embed real-time voice, video, interactive live-streaming, chat, whiteboard, and artificial intelligence capabilities into their applications without the need to develop the technology or build the underlying infrastructure themselves. The real-time data transmission is handled by the Companys Software-Defined Real-Time Network (SD-RTN), which is a virtual network overlay on top of the public Internet.', 'Santa Clara, CA, United States', 608);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FLGT', 'STOCK', 'Fulgent Genetics, Inc.', 'NGM', 'Healthcare', 'Diagnostics & Research', 'Fulgent Genetics, Inc. is a technology-based company with a laboratory services business and a therapeutic development business. Its laboratory services business includes technical laboratory and testing services and professional interpretation of laboratory results by licensed physicians. Its therapeutic development business is focused on developing drug candidates for treating a range of cancers using a novel nanoencapsulation and targeted therapy platform designed to improve the therapeutic window and pharmacokinetic profile of new and existing cancer drugs. Its testing services include comprehensive anatomic pathology testing services, including gastrointestinal pathology, dermatopathology, urologic pathology, breast pathology, neuropathology, and hematopathology, and precision diagnostics testing services, including next-generation sequencing (NGS), tests for biopharma research and clinical tests for rare disease, hereditary cancer, reproductive health, and many other diseases.', 'El Monte, CA, United States', 1313);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EGP', 'STOCK', 'EastGroup Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Industrial', 'EastGroup Properties, Inc. is an internally managed equity real estate investment trust (REIT). The Company is focused on the development, acquisition, and operation of industrial properties in Sunbelt markets throughout the United States, primarily in the states of Florida, Texas, Arizona, California, and North Carolina. The Company owns approximately 563 industrial properties in 12 states. The Companys portfolio includes development projects and value-added properties under lease-up and construction, including approximately 63.1 million square feet consisting of 497 business distribution properties containing 57.8 million square feet, 17 bulk distribution properties containing 4.4 million square feet, and 22 business service properties containing 900,000 square feet. The Companys properties are Riverpoint Industrial Park, Akimel Gateway, Waterford Distribution Center, Chestnut Business Center, and others.', 'Ridgeland, MS, United States', 101);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OLB', 'STOCK', 'The OLB Group, Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'The OLB Group, Inc. is a fintech company that focuses on a suite of products in the merchant services marketplace and seeks to provide integrated business solutions to merchants throughout the United States. It seeks to provide merchants with a range of products and services through its various online platforms, including financial and transaction processing services. Its business functions through three subsidiaries: eVance, Inc. (eVance), OmniSoft.io, Inc. (OmniSoft), and CrowdPay.Us, Inc. (CrowdPay). OmniSoft operates a cloud-based business management platform that provides turnkey solutions for merchants to enable them to build and manage their retail businesses. eVance provides competitive payment processing solutions to merchants, which enable merchants to process credit and debit card-based Internet payments for sales of their products. CrowdPay operates a white-label capital-raising platform that targets small and midsized businesses seeking to raise capital.', 'New York, NY, United States', 15);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARIS', 'STOCK', 'Aris Water Solutions, Inc.', 'NYQ', 'Utilities', 'Utilities - Regulated Water', 'Aris Water Solutions, Inc. is an environmental infrastructure and solutions company. The Company helps customers reduce their water and carbon footprints. It delivers full-cycle water handling and recycling solutions for energy operations. Its integrated pipelines and related infrastructure create produced water management, recycling, and supply solutions for operators in the core areas of the Permian Basin. The Company manages its business through a single operating segment comprising two primary revenue streams: Produced Water Handling and Water Solutions. The Produced Water Handling business gathers, transports and, unless recycled, handles produced water generated from oil and natural gas production. The Water Solutions business develops and operates recycling facilities to treat, store and recycle produced water. The Company also supplements its recycled produced water with non-potable groundwater to meet the demands of its customers'' operations.', 'Houston, TX, United States', 276);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FALN', 'STOCK', 'iShares Fallen Angels USD Bond ETF', 'NGM', NULL, NULL, 'The fund will invest at least 80% of its assets in the component securities of the underlying index, and the fund will invest at least 90% of its assets in fixed income securities of the types included in the underlying index. The index is designed to reflect the performance of U.S. dollar denominated, high yield corporate bonds that were previously rated investment grade.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSBR', 'STOCK', 'Banco Santander (Brasil) S.A.', 'NYQ', 'Financial Services', 'Banks - Regional', 'O Banco Santander Brasil SA é um banco brasileiro. O Banco atua através de dois segmentos: Varejo e Atacado. O segmento Varejo presta serviços financeiros a particulares, bem como a pequenas e médias empresas. O segmento de Atacado concentra-se em grandes corporações e mercados de capitais. Juntamente com as suas subsidiárias, o Banco oferece uma gama de serviços financeiros, incluindo serviços bancários de consumo, comercial e de investimento, empréstimos e financiamentos, empréstimos hipotecários, leasing, operações de cartão de crédito e câmbio. O Banco também está envolvido nas operações de gestão de ativos, capitalização, corretagem de valores mobiliários, corretagem de seguros e planos de pensões. A Companhia possui diversas subsidiárias, como Santander Corretora de Cambio e Valores Mobiliarios SA, Banco Bandepe SA e Sancap Investimentos e Participações SA, entre outras.', 'São Paulo, SP, Brazil', 53918);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('LPAA', 'STOCK', 'Launch One Acquisition Corp.', 'NGM', 'Financial Services', 'Shell Companies', 'Launch One Acquisition Corp. is a blank check company. The Company is formed for the purpose of effecting a merger, amalgamation, share exchange, asset acquisition, share purchase, reorganization, or similar business combination with one or more businesses. It has not selected any business combination target and the Company has not, nor has anyone on its behalf, engaged in any substantive discussions, directly or indirectly, with any business combination target. It has no operations nor generated any revenues.', 'Oakland, CA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHMI', 'STOCK', 'Cherry Hill Mortgage Investment Corporation', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Cherry Hill Mortgage Investment Corporation is a real estate finance company. The Company is focused on acquiring, investing in, and managing residential mortgage assets in the United States. Its segments include investments in residential mortgage-backed securities (RMBS), investments in Servicing Related Assets, and All Other. The Companys principal objective is to generate yields and risk-adjusted total returns for its stockholders over the long term, primarily through dividend distributions and secondarily through capital appreciation. The Company focuses on attaining this objective by selectively constructing and actively managing a portfolio of servicing-related assets and RMBS. The Company may also invest in other cash -lowing residential mortgage assets. It is externally managed by Cherry Hill Mortgage Management, LLC.', 'Tinton Falls, NJ, United States', 12);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EARN', 'STOCK', 'Ellington Credit Company', 'NYQ', 'Financial Services', 'Asset Management', 'Ellington Credit Company is a non-diversified closed-end fund. The Company is focused on acquiring, investing in, and managing secondary collateralized loan obligations (CLO) mezzanine debt and equity tranches. It is specialized in acquiring, investing in, and managing residential mortgage- and real estate-related assets. The Company''s primary objective is to generate attractive risk-adjusted total returns for its shareholders by making investments in multiple parts of the CLO capital structure, including mezzanine debt and equity tranches. Additionally, it may also invest in CLO loan accumulation facilities, which are entities that acquire corporate loans and other similar corporate credit-related assets in anticipation of ultimately collateralizing a CLO transaction, as well as other related assets. It is externally managed and advised by Ellington Credit Company Management LLC.', 'Old Greenwich, CT, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMDG', 'STOCK', 'Themes ETF Trust - Leverage Shares 2X Long AMD Daily ETF', 'NGM', NULL, NULL, NULL, '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OSRH', 'STOCK', 'OSR Holdings, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'OSR Holdings, Inc. is a global healthcare company, dedicated to advancing healthcare outcomes and improving the quality of life for people and their families. The Company is focused on building and developing a portfolio of transformative therapies and healthcare solutions. The Company''s operating businesses (through its three wholly owned subsidiaries) include developing oral immunotherapies for the treatment of cancer, developing design-augmented biologics for age-related and other degenerative diseases and neurovascular intervention medical device and systems distribution in Korea. The Companys subsidiary, Vaximms flagship asset, VXM01, is a late clinical-stage (NCT037500701) immuno-oncology candidate for glioblastoma. Vaximm has three clinical and pre-clinical drug candidates targeting diseases ranging from glioblastoma to gastrointestinal stromal tumor to ocular diseases. The Company has operations in Europe and South Korea.', 'Bellevue, WA, United States', 19);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKH', 'STOCK', 'Black Hills Corporation', 'NYQ', 'Utilities', 'Utilities - Regulated Gas', 'Black Hills Corporation is a customer-focused, growth-oriented utility company. It serves 1.35 million natural gas and electric utility customers in eight states: Arkansas, Colorado, Iowa, Kansas, Montana, Nebraska, South Dakota and Wyoming. Its segments include Electric Utilities and Gas Utilities. Its Electric Utilities segment generates, transmits and distributes electricity to approximately 225,000 electric utility customers in Colorado, Montana, South Dakota, and Wyoming. Its Electric Utilities own 1,394 megawatts of generation and 9,196 miles of electric transmission and distribution lines. Its Gas Utilities segment serves over 1,128,000 natural gas utility customers in Arkansas, Colorado, Iowa, Kansas, Nebraska, and Wyoming. Its Gas Utilities own and operate 4,648 miles of intrastate gas transmission pipelines and 44,524 miles of gas distribution mains and service lines, seven natural gas storage sites, over 50,000 horsepower of compression, and 516 miles of gathering lines.', 'Rapid City, SD, United States', 2841);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EGBN', 'STOCK', 'Eagle Bancorp, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'Eagle Bancorp, Inc. is a bank holding company for EagleBank (the Bank). The Bank is a chartered commercial bank. The Company, through the Bank, conducts a full-service community banking business in Northern Virginia, Suburban Maryland and Washington, D.C. The primary financial services offered by the Bank include real estate, commercial and consumer lending, as well as traditional deposit and repurchase agreement products. The Bank offers a range of commercial banking services to its business and professional clients, as well as consumer banking services to individuals living and/or working primarily in the Banks market area. The Banks loan portfolio consists of traditional business and real estate secured loans. It operates 12 branch offices: six in Suburban Maryland, three located in the District of Columbia, and three in Northern Virginia. It also has four lending centers and utilizes various digital capabilities, including remote deposit services and mobile banking services.', 'Bethesda, MD, United States', 451);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CXW', 'STOCK', 'CoreCivic, Inc.', 'NYQ', 'Industrials', 'Security & Protection Services', 'CoreCivic, Inc. is a diversified, government-solutions company. The Company provides a range of solutions to government partners that serve the public good through corrections and detention management, a network of residential and non-residential alternatives to incarceration to help address Americas recidivism crisis, and government real estate solutions. Its CoreCivic Safety segment consists of correctional and detention facilities that are owned or controlled via a long-term lease and managed by the Company, as well as those correctional and detention facilities owned by third parties but managed by the Company. The segment also provides transportation services. CoreCivic Community segment consists of residential reentry centers that are owned or controlled via a long-term lease and managed by the Company. The segment also includes electronic monitoring and case management services. CoreCivic Properties segment consists of correctional real estate properties owned by the Company.', 'Brentwood, TN, United States', 11649);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMN', 'STOCK', 'AMN Healthcare Services, Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'AMN Healthcare Services, Inc. is a provider of total talent solutions for healthcare organizations across the United States. The Company provides access to a comprehensive network of quality healthcare professionals through its recruitment strategies and breadth of career opportunities. Its segments include nurse and allied solutions, physician and leadership solutions, and technology and workforce solutions. The nurse and allied solutions segment includes its travel nurse staffing, labor disruption staffing, local staffing, international nurse permanent placement, and allied staffing businesses. The physician and leadership solutions segment includes its locum tenens staffing, healthcare interim leadership staffing, executive search, and physician permanent placement businesses. The technology and workforce solutions segment includes the Companys language services, vendor management systems (VMS), workforce optimization, and outsourced solutions businesses.', 'Dallas, TX, United States', 2968);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVDL', 'STOCK', 'Avadel Pharmaceuticals plc', 'NGM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Avadel Pharmaceuticals PLC is a biopharmaceutical company. The Company''s product, LUMRYZ, is an extended-release formulation of sodium oxybate, indicated to be taken once at bedtime for the treatment of cataplexy or excessive daytime sleepiness (EDS) in adults with narcolepsy. Its approach includes applying solutions to the development of medications that address the challenges patients face with treatment options. Its drug delivery technologies include MICROPUMP, LIQUITIME, and MEDUSA. Its MICROPUMP technology allows for the development of modified-release solid, oral dosage formulations of drugs. Its LIQUITIME technology allows for the development of modified-release oral products in a liquid suspension formulation, which may make such formulations particularly suited for children and/or patients having issues swallowing tablets or capsules. Its MEDUSA technology allows for the development of modified-release injectable dosage formulations of drugs.', 'Dublin, , Ireland', 188);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLB', 'STOCK', 'Core Laboratories Inc.', 'NYQ', 'Energy', 'Oil & Gas Equipment & Services', 'Christina Lake Cannabis Corp. is a Canada-based licensed producer of cannabis. The Company is engaged in the processing of its stock of outdoor flowers. They also process dried Cannabis biomass into various extracts, including distilled and winterized oils, kief, and additional extracted products for sale to other licensed producers. The Companys facilities consist of a 32-acre property, which includes over 950,000 square feet of outdoor grow space, offices, propagation and drying rooms, research facilities, and a facility dedicated to processing and extraction. The 342-acre property includes approximately 100-acres of licensed outdoor grow space, greenhouses, and a dryroom. The Company also owns a 99-acre plot of land adjoining its principal site. It focuses its production on creating extracts and distillates for its business-to-business (B2B) client base with proprietary strains specifically developed for outdoor cultivation to enhance extraction quality.', 'Houston, TX, United States', 3300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRW', 'STOCK', 'Saba Capital Income & Opportunities Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Saba Capital Income & Opportunities Fund is a closed-ended fixed income mutual fund launched by Voya Investment Management LLC. The fund is managed by Saba Capital Management, L.P. It invests in the fixed income markets of the United States. The fund seeks to invest in securities of companies operating across diversified sectors. It primarily invests in floating rate secured senior loans, with an emphasis on top-tier, non-investment grade senior loans. The fund seeks to invest in loans with maturities of one to ten years. It benchmarks the performance of its portfolio against the S&P/LSTA Leveraged Loan Index. The fund was formerly known as Voya Prime Rate Trust. Saba Capital Income & Opportunities Fund was formed on December 2, 1987 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('E', 'STOCK', 'Eni S.p.A.', 'NYQ', 'Energy', 'Oil & Gas Integrated', 'A Eni SpA (Eni) é uma empresa com sede na Itália que se dedica à exploração, desenvolvimento e produção de hidrocarbonetos, ao fornecimento e comercialização de gás, gás natural liquefeito (GNL) e energia, no refino e comercialização de produtos petrolíferos, na produção e comercialização de petroquímicos básicos, plásticos e elastômeros e no comércio de mercadorias. Seu segmento de Exploração e Produção se dedica à exploração de petróleo e gás natural e ao desenvolvimento e produção de campo, além de operações de GNL em mais de 40 países, incluindo Itália, Líbia, Egito, Noruega, Reino Unido, Angola, Congo, Nigéria e Estados Unidos, Cazaquistão, Argélia, Austrália, Venezuela, Iraque, Gana e Moçambique. Seu segmento de Gás e Energia atua no fornecimento, comercialização e comercialização de gás, GNL e eletricidade, atividades de transporte internacional de gás e comércio de mercadorias e derivados.', 'Rome, RM, Italy', 32356);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCOI', 'STOCK', 'Cogent Communications Holdings, Inc.', 'NMS', 'Communication Services', 'Telecom Services', 'Cogent Communications Holdings, Inc. is a facilities-based provider of Internet access, private network services, optical wavelength, and optical transport services and data center colocation space and power. The Company, through its own facilities, offers on-net Internet access services to customers located in buildings that are physically connected to its network. Its network is specifically designed and optimized to transmit packet routed data. Its on-net service consists of high-speed Internet access and private network services offered at speeds ranging from 100 megabits per second (Mbps) to 400 gigabits per second (Gbps). The Company delivers its services on its network in 56 countries across North America, Europe, South America, Oceania and Africa. Its corporate customers are located in multi-tenant office buildings (MTOBs), which include law firms, advertising and marketing firms, as well as healthcare providers, and other professional services businesses, among others.', 'Washington, DC, United States', 1916);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BZUN', 'STOCK', 'Baozun Inc.', 'NMS', 'Consumer Cyclical', 'Internet Retail', 'Baozun Inc is a holding company mainly engaged in the provision of brand e-commerce solutions. The Company focus on providing integrated brand-e-commerce solutions to their brand partners, including information technology (IT) solutions, online store operation, digital marketing, customer services, as well as warehousing and fulfillment. The Company operates under three business models: distribution model, service fee model and consignment mode, according to different needs of their brand partners. The Company provides omni-channel solutions across official brand stores, online marketplaces, such as Tmall, JD.com and Pinduoduo, and social media channels, such as WeChat Mini Programs and RED (Xiaohongshu), as well as emerging live streaming and short video platforms, such as Douyin and Kuaishou.', 'Shanghai, , China', 7650);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CARG', 'STOCK', 'CarGurus, Inc.', 'NMS', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'CarGurus, Inc. (CarGurus) offers a multinational, online automotive platform for buying and selling vehicles that offer both digital retail solutions and the CarOffer digital wholesale platform. The CarGurus platform enables consumers to purchase and/or sell a vehicle either online or in-person, and it gives dealerships the power to accurately price, instantly acquire, effectively market, and quickly sell vehicles, all with a nationwide reach. It operates through two segments: U.S. Marketplace and Digital Wholesale. The U.S. Marketplace segment provides marketplace services for customers within the United States. Digital Wholesale segment provides Dealer-to-Dealer and Instant Max Cash Offer (IMCO) services and products which are sold on the CarOffer platform. The Company operates online marketplaces under the CarGurus brand in Canada and the United Kingdom. It also operates independent brands, the Autolist and PistonHeads online marketplaces in the United States and the United Kingdom.', 'Boston, MA, United States', 1282);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABUS', 'STOCK', 'Arbutus Biopharma Corporation', 'NMS', 'Healthcare', 'Biotechnology', 'Arbutus Biopharma Corporation is a clinical-stage biopharmaceutical company focused on infectious disease. The Company is developing imdusiran (AB-729), its proprietary, conjugated GalNAc, subcutaneously delivered RNAi therapeutic, and AB-101, its proprietary oral PD-L1 inhibitor, for the treatment of chronic hepatitis B (cHBV). Its HBV product pipeline includes Imdusiran and AB-101. Its pipeline includes two product candidates that target various steps in the HBV viral lifecycle and consists of various programs: RNAi therapeutic (imdusiran, AB-729) and Oral PD-L1 Inhibitor (AB-101). RNAi therapeutics utilize a natural pathway within cells to silence genes by eliminating the disease-causing proteins that they code for. PD-L1 inhibitors complement its pipeline of agents and could potentially be a part of a combination therapy for the treatment of HBV by reawakening the immune system.', 'Warminster, PA, United States', 44);\n